INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (5, 40011, 2, 24001, "クリア", 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 0, 325);
